INSERT INTO [dbo].[Ingredient] ([Id], [Name], [Description], [Price]) VALUES (0, N'Tofu', N'ofu, also known as bean curd, is a food made by coagulating soy milk and then pressing the resulting curds into soft white blocks. ', 1.0000000000)
