INSERT INTO [dbo].[Dish] ([Id], [Name], [Description], [Price], [IdImage]) VALUES (0, N'Thai Spicy Basil Fried Rice', N'This is a staple of Thai cooking. Adjust the spices to your own tastes for a really great use for leftover rice!! I get the basil from a local Asian market. It has a different flavor than that of regular basil and makes all the difference in this recipe. It is fast and fairly easy to make, but requires constant stirring', 12.9900000000, 1)
INSERT INTO [dbo].[Dish] ([Id], [Name], [Description], [Price], [IdImage]) VALUES (1, N'Garlic Paradise', N'From the world-famous Gilroy Garlic Festival to a fierce 40-clove garlic chicken in San Francisco and a gut-busting garlic sandwich in Philly, we feature the tastiest places to get your garlic on.', 7.9900000000, 2)
INSERT INTO [dbo].[Dish] ([Id], [Name], [Description], [Price], [IdImage]) VALUES (2, N'Thai green chicken curry', N'Master this aromatic, creamy & extremely tasty chicken Thai green curry recipe from Jamie Oliver & treat yourself to an authentic taste of South East Asia.', 14.7500000000, 3)
INSERT INTO [dbo].[Dish] ([Id], [Name], [Description], [Price], [IdImage]) VALUES (3, N'Thai Peanut', N'This easy no-cook peanut sauce has a terrific authentic Thai taste. It is spicy and peanutty, and is perfect as a dipping sauce for chicken, shrimp, and beef...or even to use tossed with warm cooked noodles for a quick pasta dish.', 12.2500000000, 4)
INSERT INTO [dbo].[Dish] ([Id], [Name], [Description], [Price], [IdImage]) VALUES (4, N'Thai Thighs', N'Grill over a smoker or just brown in the oven - these moreish chicken pieces are marinated in a blend of lime and pineapple juice, chilli and ginger.', 8.9900000000, 5)
INSERT INTO [dbo].[Dish] ([Id], [Name], [Description], [Price], [IdImage]) VALUES (5, N'Thai Roasted', N'This recipe takes that same approach, but instead of lemon as the primary flavor, were mixing up a Thai-inspired sauce of lime, a little brown sugar, Sriracha, soy, fish sauce, ginger, and garlic. It may sound like a lot of ingredients, but I bet you have most of these sitting in your pantry already!', 22.1500000000, 6)
